      paid to this vendor is less than $200. Expenditures to Faulkner Strategies,
      Campaign Graphics, The Hopper Company and Political Ink LLC on Sch B, line 30b,
      represent exempt activity expenditures as defined in 11 CFR 100.87 and 100.147
      and were distributed by volunteers. These expenses were not paid for with transfers
      in from the Republican National Committee or from funds designated for a particular
      candidate. No expenditure, other than a direct contribution or exempt activity
      so identified, was made on behalf of a specifically identified federal candidate.
      No expenditure not identified as such was for a public communication that referred
      to a clearly identified candidate for Federal office and that promoted, supported,
      attacked or opposed any such candidate for Federal office. All expenditures
      to individuals for rent represent rent income to those individuals and are not
      required to be itemized. All disbursements for salaries and benefits disclosed
      on Schedule H4 are for employees who did not spend more than 25% of their compensated
      time during the reporting period on Fed election activities or activities in
      connection with a Federal election. All transfers for allocated activity reported
      on Sch H3 occurred within the 70-day permitted window of time. The Committee
      uses the Escrow option for receipt of corporate in-kind donations as provided
      for by the Commission in Advisory Opinion 1992-33. The method ensures that prohibited
      sources are not used to fund the federal share of allocable activity expenses.
      In-kind details and the escrow account activity are summarized as follows:   Admin
      Acct: 10/1/10 Admin escrow balance $3,365.75   10/1/10 transfer to Admin escrow
